import React, { useState, useEffect } from 'react';

const Home = () => {
    const [tasks, setTasks] = useState([]);
    const [activity, setActivity] = useState('');
    const [blockchainStatus, setBlockchainStatus] = useState('');

    useEffect(() => {
        // Fetch tasks and blockchain status on component mount
        fetch('/tasks')
            .then(response => response.json())
            .then(data => setTasks(data))
            .catch(error => console.error('Error fetching tasks:', error));

        fetch('/isValid')
            .then(response => response.text())
            .then(data => setBlockchainStatus(data))
            .catch(error => console.error('Error checking blockchain validity:', error));
    }, []);

    const handleAddTask = () => {
        // Make a POST request to add a task
        fetch('/addTask', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ activity }),
        })
            .then(response => response.json())
            .then(data => {
                console.log(data);
                // Refresh task list after adding a task
                fetch('/tasks')
                    .then(response => response.json())
                    .then(data => setTasks(data))
                    .catch(error => console.error('Error fetching tasks:', error));
            })
            .catch(error => console.error('Error adding task:', error));
    };

    const handleInsertMaliciousBlock = () => {
        // Make a POST request to insert a malicious block
        fetch('/insertMaliciousBlock', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ activity }),
        })
            .then(response => response.json())
            .then(data => {
                console.log(data);
                // Refresh blockchain status after inserting a malicious block
                fetch('/isValid')
                    .then(response => response.text())
                    .then(data => setBlockchainStatus(data))
                    .catch(error => console.error('Error checking blockchain validity:', error));
            })
            .catch(error => console.error('Error inserting malicious block:', error));
    };

    return (
        <div className="container" style={{ maxWidth: '1496px', maxHeight: '260px', position: 'relative' }}>
            <div style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%', backgroundColor: 'white', zIndex: 1 }}></div>
            <div style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%', backgroundColor: '#f0f0f0', zIndex: 2, padding: '20px' }}>
                <h1 className="mb-4">My Blockchain To-Do List</h1>

                <div className="mb-4">
                    <h2>Add Task</h2>
                    <div className="input-group">
                        <input
                            type="text"
                            className="form-control form-control-sm"
                            value={activity}
                            onChange={e => setActivity(e.target.value)}
                        />
                        <div className="input-group-append">
                            <button className="btn btn-primary" onClick={handleAddTask}>
                                Add Task
                            </button>
                        </div>
                    </div>
                </div>

                <div className="mb-4">
                    <h2>Insert Malicious Block</h2>
                    <div className="input-group">
                        <input
                            type="text"
                            className="form-control form-control-sm"
                            value={activity}
                            onChange={e => setActivity(e.target.value)}
                        />
                        <div className="input-group-append">
                            <button className="btn btn-danger" onClick={handleInsertMaliciousBlock}>
                                Insert Malicious Block
                            </button>
                        </div>
                    </div>
                </div>

                <div>
                    <h2>Task List</h2>
                    <ul className="list-group">
                        {tasks.map(task => (
                            <li key={task.id} className="list-group-item">
                                {task.name}
                            </li>
                        ))}
                    </ul>
                </div>
            </div>
        </div>
    );
};

export default Home;
